import Button from "./Button";
import "./Input.css";

function Input({ checked, handleChecked, disabled }) {
  const [value, setValue] = useState("");

  const handleChange = (e) => {
    if (!checked) {
      setValue("");
    } else {
      setValue(e.target.value);
    }
  };

  return (
    <>
      <div className="rectangle">
        <Button />
